"use strict";$(document).ready(function(){var a=$('[id="send"]');var b=$('form[name="contact"]');a.on("click",function(){b.submit()});b.submit(function(d){d.preventDefault();var c=b.serialize();$.ajax({url:"",type:"POST",data:c,processData:false,cache:false,dataType:"json",success:function(e){if(e.status=="success"){$("p.error").html('<img src="images/gif-load-black.gif" style="width: 25px;"/>');$("p.error").html(e.message);$("p.error").parent().show();location.reload()}if(e.status=="error"){$("p.error").html(e.message);$("p.error").parent().show()}}})})});